"use strict";(self.webpackChunkZeblog=self.webpackChunkZeblog||[]).push([[1493],{20273:(t,p,d)=>{d.r(p),d.d(p,{default:()=>X});var a=d(4270);const e=d.p+"assets/img/clipboard.09076f2d.png",r=d.p+"assets/img/wpsF6D3.tmp.b69df271.png",s=d.p+"assets/img/clipboard-164300756187145.7911c3bc.png",h=d.p+"assets/img/clipboard-164300757501646.4b051844.png",i=d.p+"assets/img/clipboard-164300770414847.78cdefbc.png",n=d.p+"assets/img/clipboard-164300771684848.dc48c73a.png",l=d.p+"assets/img/clipboard-164300773194449.d95bf39c.png",c=d.p+"assets/img/clipboard-164300774606750.d86ab119.png",f=d.p+"assets/img/clipboard-164300775941551.200780f7.png",A=d.p+"assets/img/clipboard-164300778784352.24e688df.png",g=d.p+"assets/img/clipboard-164300785802553.4a91d66a.png",m=d.p+"assets/img/clipboard-164300787235154.2726618c.png",b=d.p+"assets/img/clipboard-164300791359755.8e8c8721.png",o=d.p+"assets/img/clipboard-164300793512156.3e8fd38d.png",x=d.p+"assets/img/clipboard-164300797293058.5929c5c8.png",P=d.p+"assets/img/clipboard-164300802989159.e08c1b33.png",v=d.p+"assets/img/clipboard-164300804161160.858fbcc3.png",E=d.p+"assets/img/clipboard-164300806402661.ceb3be7c.png",w=d.p+"assets/img/clipboard-164300808071162.b84be7c8.png",B=d.p+"assets/img/clipboard-164300809395863.8f25601b.png",j=d.p+"assets/img/clipboard-164300810864464.32bf2a53.png",T=d.p+"assets/img/clipboard-164300812235465.a0d416c3.png",H=d.p+"assets/img/clipboard-164300813569966.859aeedb.png",W=d.p+"assets/img/clipboard-164300815924067.27ce156a.png",u=d.p+"assets/img/clipboard-164300816955868.92386bbf.png",F=d.p+"assets/img/clipboard-164300818277369.4fc5d4b5.png",z=d.p+"assets/img/结构力学(第四版_上册_李廉锟)_WPS图片.ba8a26d8.jpg",N=d.p+"assets/img/结构力学(第四版_上册_李廉锟)2.12bb5c38.jpg",D=d.p+"assets/img/结构力学(第四版_上册_李廉锟)3.07772496.jpg",M=[(0,a.uE)('<p>[TOC]</p><h1 id="科目" tabindex="-1"><a class="header-anchor" href="#科目" aria-hidden="true">#</a> 科目</h1><table><thead><tr><th><strong>复习科目、做题顺序</strong></th><th><strong>规范</strong></th><th><strong>时间</strong></th></tr></thead><tbody><tr><td>钢结构</td><td>荷规、钢规</td><td>8:00-9:15</td></tr><tr><td>砌体结构</td><td>抗规、砌规</td><td>9:15-10:15</td></tr><tr><td>混凝土结构</td><td>荷规、抗规、混规</td><td>10:15-11:45</td></tr><tr><td>木结构</td><td>木规</td><td>14:00-14:45</td></tr><tr><td>公路桥梁</td><td>公桥通规、公桥混规、城市桥规、城桥震规</td><td></td></tr><tr><td>地基基础</td><td>地规、桩规、地处规、抗规</td><td></td></tr><tr><td>高层建筑结构</td><td>荷规、高规、抗规</td><td></td></tr></tbody></table><h1 id="简支梁最大挠度" tabindex="-1"><a class="header-anchor" href="#简支梁最大挠度" aria-hidden="true">#</a> 简支梁最大挠度</h1><p><img src="'+e+'" alt=""></p><h1 id="一注真题注意要点" tabindex="-1"><a class="header-anchor" href="#一注真题注意要点" aria-hidden="true">#</a> 一注真题注意要点</h1><p><strong>通用</strong></p><p>自由度=3x刚片数-2x铰点数-支座链杆数</p><p>标准值、设计值 斜向荷载值 x cosα 剪力为0处弯矩值最大</p><p>跨中弯矩计算按计算跨度 支座剪力计算按净跨</p><p><strong>混凝土结构</strong></p><p>纵筋保护层厚度=保护层厚度+箍筋直径</p><p><strong>有效高度估算</strong></p><p>梁的纵向受力钢筋按一排布置时，h0=h-20-6-20/2</p><p>梁的纵向受力钢筋按二排布置时，h0=h-20-6-20-25/2</p><p>板的截面有效高度 h0=h-15-10/2</p><p><strong>厂房</strong></p><p>只有计算排架时，才会有多台吊车的折减系数；对吊车梁计算，不考虑折减，且要考虑动力放大</p><p><strong>砌体结构</strong></p><p>砌体墙抗震受剪承载力计算面积包括两侧构造柱</p><p>无筋砌体构件截面&lt;0.3m2时，乘以α=A+0.7的折减系数</p><p>砌体底层柱反弯点的高度比可取0.55</p><p><strong>木结构</strong></p><p>木材强度和弹模的各项调整；原木、矩形短边尺寸≥150mm、湿材、使用条件、使用年限</p><p>受拉构件净截面面积An要扣除分布在150mm长度上的缺孔投影面积</p><p>原木构件沿其长度的直径变化率</p><p><strong>地基基础</strong></p><p>计算基地最大压应力时，应注意是否存在零压力区，两种公式不一样</p><p>验算地基承载力时，注意软弱下卧层的验算</p><p>冲切计算时，应注意冲切破坏椎体内的净反力设计值，柱边各h0，冲切计算周长是柱边各h0/2</p><p><strong>题型</strong></p><p>单筋正截面</p><p>锚固长度</p><p>弯剪扭</p><p>底部剪力法：水平地震剪力标准值=Σ该层以上水平地震作用标准值之和</p><p>层间位移角</p><p>体积配箍率</p><p>轴压比</p><p>双向受弯构件的抗弯强度</p><p>压弯构件</p><p>角焊缝</p><p>风荷载 女儿墙体型系数1.25*1.3</p><h1 id="梁箍筋的面积配筋率计算" tabindex="-1"><a class="header-anchor" href="#梁箍筋的面积配筋率计算" aria-hidden="true">#</a> 梁箍筋的面积配筋率计算</h1><p>配置在同一截面(b×s，b为矩形构件截面宽度，s为箍筋间距)内箍筋各肢的全部截面面积与该截面面积的的比率。</p><p><img src="'+r+'" alt=""></p><h1 id="柱体积配箍率计算" tabindex="-1"><a class="header-anchor" href="#柱体积配箍率计算" aria-hidden="true">#</a> 柱体积配箍率计算</h1><p><strong>柱箍筋加密区箍筋的最小体积配筋率应按下式计算：</strong></p><p><img src="data:image/jpeg;base64," alt=""></p><p>式中：ρvmin——柱箍筋加密区箍筋的最小体积配筋率，一级不应小于0.8%，二级不应小于0.6%，三、四级不应小于0.4%；</p><p>λv——最小配箍特征值，取值见表2.1.1；</p><p>fc——混凝土轴心抗压强度设计值；当强度等级低于C35时，按C35取值；</p><p>fyv——箍筋及拉筋抗拉强度设计值。</p><p><img src="'+s+'" alt=""></p><p><img src="'+h+'" alt=""></p><p>注意：根据《混凝土结构设计规范》GB 50010-2010的4.2.3条规定：横向钢筋的抗拉强度设计值fyv应按表中fy的数值采用；但用作受剪、扭、冲切时，其数值大于360N/mm2时应取360N/mm2。</p><h6 id="柱加密区最小配箍特征值" tabindex="-1"><a class="header-anchor" href="#柱加密区最小配箍特征值" aria-hidden="true">#</a> 柱加密区最小配箍特征值</h6><table><thead><tr><th>抗震等级</th><th>箍筋形式</th><th>轴压比</th><th>&lt;&lt;</th><th>&lt;&lt;</th><th>&lt;&lt;</th><th>&lt;&lt;</th><th>&lt;&lt;</th><th>&lt;&lt;</th><th>&lt;&lt;</th><th>&lt;&lt;</th></tr></thead><tbody><tr><td>^^</td><td>^^</td><td>≤0.3</td><td>0.4</td><td>0.5</td><td>0.6</td><td>0.7</td><td>0.8</td><td>0.9</td><td>1.0</td><td>1.05</td></tr><tr><td>一级</td><td>普通箍、复合箍</td><td>0.10</td><td>0.11</td><td>0.13</td><td>0.15</td><td>0.17</td><td>0.20</td><td>0.23</td><td>--</td><td>--</td></tr><tr><td>^^</td><td>螺旋箍、复合或连续复合矩形螺旋箍</td><td>0.08</td><td>0.09</td><td>0.11</td><td>0.13</td><td>0.15</td><td>0.18</td><td>0.21</td><td>--</td><td>--</td></tr><tr><td>二级</td><td>普通箍、复合箍</td><td>0.08</td><td>0.09</td><td>0.11</td><td>0.13</td><td>0.15</td><td>0.17</td><td>0.19</td><td>0.22</td><td>0.24</td></tr><tr><td>^^</td><td>螺旋箍、复合或连续复合矩形螺旋箍</td><td>0.06</td><td>0.07</td><td>0.09</td><td>0.11</td><td>0.13</td><td>0.15</td><td>0.17</td><td>0.20</td><td>0.22</td></tr><tr><td>三级</td><td>普通箍、复合箍</td><td>0.06</td><td>0.07</td><td>0.09</td><td>0.11</td><td>0.13</td><td>0.15</td><td>0.17</td><td>0.20</td><td>0.22</td></tr><tr><td>^^</td><td>螺旋箍、复合或连续复合矩形螺旋箍</td><td>0.05</td><td>0.06</td><td>0.07</td><td>0.09</td><td>0.11</td><td>0.13</td><td>0.15</td><td>0.18</td><td>0.20</td></tr></tbody></table><p>注：1.普通箍指单个矩形箍筋或单个圆形箍筋；螺旋箍指单个螺旋箍筋；复合箍指由矩形、多边形、圆形箍筋或拉筋组成的箍筋；复合螺旋箍指由螺旋箍与矩形、多边形、圆形箍筋或拉筋组成的箍筋；连续复合矩形螺旋箍指全部螺旋箍为同一根钢筋加工成的箍筋；2.在计算复合螺旋箍的体积配筋率时，其中非螺旋箍筋的体积应乘以换算系数0.8；3.混凝土强度等级高于C60时，箍筋宜采用复合箍、复合螺旋箍或连续复合矩形螺旋箍；当轴压比不大于0.6时，其加密区的最小配箍特征值宜按表中数值增加0.02；当轴压比大于0.6时，宜按表中数值增加0.03。2.对一、二、三、四级抗震等级的柱，其箍筋加密区的箍筋体积配筋率分别不应小于0.8%、0.6%、0.4%和0.4%；3.框支柱宜采用复合螺旋箍或井字复合箍，其最小配箍特征值应按表11．4．17中的数值增加0．02采用，且体积配筋率不应小于1．5％；4.当剪跨比λ不大于2时，宜采用复合螺旋箍或井字复合箍，其箍筋体积配筋率不应小于1．2％；9度设防烈度一级抗震等级时，不应小于1．5％。</p><p>柱截面形式包括方形、矩形、圆形、L形、T形和十字形。箍筋体积配箍率计算公式参见表2.1.2。公式中s为箍筋间距、s1为螺距，x=12.5mm。箍筋长度取所有箍筋（包括拉筋）的中心长度和，Acor取外圈箍筋的内表面面积。</p><p><img src="'+i+'" alt=""></p><p><img src="'+n+'" alt=""></p><p><img src="'+l+'" alt=""></p><p><img src="'+c+'" alt=""></p><p><img src="'+f+'" alt=""></p><p><strong>体积配箍率构造规定</strong></p><p>\\1. 框支柱宜采用复合螺旋箍或井字复合箍，其最小配箍特征值应按表1.1中的数值增加0.02采用，且体积配筋率不应小于1.5%；</p><p>\\2. 当剪跨比λ≤2时，一、二、三级抗震等级的柱宜采用复合螺旋箍或井字复合箍，其箍筋体积配筋率不应小于1.2%；9度一级时不应小于1.5%；；</p><p>\\3. 抗震等级为特一级的时：框架柱最小配箍特征值λv按表1.1数值增大0.02采用；框支柱按表1.1数值增大0.03采用，且箍筋体积配箍率不应小于1.6%。</p><h1 id="墙体积配箍率计算" tabindex="-1"><a class="header-anchor" href="#墙体积配箍率计算" aria-hidden="true">#</a> 墙体积配箍率计算</h1><p><img src="'+A+'" alt=""></p><h1 id="抗震等级计算" tabindex="-1"><a class="header-anchor" href="#抗震等级计算" aria-hidden="true">#</a> 抗震等级计算</h1><p><strong>题目</strong></p><p>主裙楼框支剪力墙结构，地下室顶标高-1m，裙楼3层标高16m，上部主楼13层标高55.4m（层高3m），转换层在16m，假设嵌固端在地下室顶面，地震加速度0.15g，裙楼为大型商场，主楼为公寓楼，场地土类别为 3 类土。</p><p><strong>解答</strong></p><p>\\1. 裙楼为大型商场，主楼为公寓楼，则裙楼为8级抗震措施，主楼为7级抗震措施；场地土类别为 3 类土，则裙楼为8+级抗震构造措施，主楼为8级抗震构造措施；</p><p>\\2. 抗规 6.1.10，底部加强区取框支层加框支层以上两层的高度=22.4m；</p><p>\\3. 裙楼-1m~16m范围内，抗规 6.1.2，裙楼在底部加强区内，8级抗震措施，则框支框架抗震等级为一级，其他框架抗震等级为二级；高规10.2.6，框支柱抗震等级提高一级，则：框支柱抗震等级为特一级，框支梁抗震等级为一级，裙房的非框支框架抗震等级为二级。</p><p>\\4. 主楼16m~22.4m范围内，7级抗震措施，剪力墙和框支框架中的框架梁抗震等级均为二级；高规10.2.6，剪力墙和框支柱抗震等级提高一级，则：剪力墙及强、弱连梁抗震等级均为一级。</p><p>\\5. 主楼22.4m以上，7级抗震措施，剪力墙及强、弱连梁抗震等级均为三级。</p><h1 id="挠度计算" tabindex="-1"><a class="header-anchor" href="#挠度计算" aria-hidden="true">#</a> 挠度计算</h1><table><thead><tr><th>简支梁</th><th>&lt;&lt;</th><th>悬臂梁</th><th>&lt;&lt;</th></tr></thead><tbody><tr><td>均布荷载</td><td>集中荷载作用于中点</td><td>均布荷载</td><td>集中荷载作用于端部</td></tr><tr><td>5qL^4/384EI</td><td>FL^3/48EI</td><td>qL^4/8EI</td><td>FL^3/3EI</td></tr></tbody></table><h1 id="软弱下卧层验算" tabindex="-1"><a class="header-anchor" href="#软弱下卧层验算" aria-hidden="true">#</a> 软弱下卧层验算</h1><p><img src="'+g+'" alt=""></p><p><img src="'+m+'" alt=""></p><h1 id="防水板板底等效标高" tabindex="-1"><a class="header-anchor" href="#防水板板底等效标高" aria-hidden="true">#</a> 防水板板底等效标高</h1><p>​ 现以抗浮水位为-1.5m的算例为例，防水板板面标高为-3.5m，板厚250mm，建筑面层做法重量为3kN/m2，抗浮水位为-1.5m，水浮力分项系数1.4，当不考虑防水板自重及其上荷载时，板底标高应由-3.75m调整为-3.09m。</p><p>​ 防水板水浮力下基本组合设计值</p><p>q=1.4*（3.75-1.5） <em>10-1</em>（25*0.25+3） =22.25 kN/m2</p><p>​ 防水板及建筑做法重量换算为纯水头深度</p><p>（25*0.25+3）/1.4/10=0.66m</p><p>​ 防水板板底标高由 -3.75m 调整为 （-3.75+0.66） =-3.09m</p><h1 id="温差、收缩当量温差计算实例" tabindex="-1"><a class="header-anchor" href="#温差、收缩当量温差计算实例" aria-hidden="true">#</a> 温差、收缩当量温差计算实例</h1><p>某三层钢筋混凝土现浇整体式框架结构，混凝土浇筑温度为+10℃，浇筑后经六个</p><p>月到冬季，最冷月份平均温度-10 ，此期间又经历了大部分的收缩作用，施工跨年度，</p><p>结构封闭后经受室内温差。框架梁平均截面为 250mm 500mm。试确定施工阶段的结构</p><p>承受的最不利温差、收缩当量温差和考虑徐变引起的应力松弛的综合计算温差。</p><p>4.1 最不利温差</p><p>降温差 T1=10-(-lO)=20</p><p>4.2 收缩当量温差</p><p>由于结构经历了六个月的收缩作用，现按 180 天考虑收缩差。</p><p>(1)180 天的收缩相对变形</p><p>收缩相对变形</p><p><img src="'+b+'" alt=""></p><p>计算 Mi</p><p>M1=1.0(普通水泥)</p><p>M2=1.0(水泥细度 3000)</p><p>M3=1.0(采用砾砂骨料)</p><p>M4=1.21(水/灰=0．5)</p><p>M5=1.2(水泥浆量，水+水泥重量占总重量的 25％)</p><p>M6=1.07(初期养护 4 天，自然状态)</p><p>M7=1.25(环境相对湿度 25％)</p><p>M8=0.8(水力半径倒数)</p><p><img src="'+o+'" alt=""></p><p>M9=1.0(机械振捣)</p><p><img src="data:image/png;base64," alt=""></p><p>把 t=180 和 Mi 代入收缩相对变形公式后得</p><p>y(t=180)=3.24×10-4×1.21×1.2×1.07×1.25</p><p>×0.8×0.76×(1-e-1.8) =3．2×10-4</p><p>(2)180 天的收缩当量温差</p><p><img src="'+x+'" alt=""></p><p>4．3 综合计算温差</p><p>因为最不利温差为降温，而收缩当量温差为负(相当降温)，所以综合计算温差也</p><p>为负值，其值为两者叠加。</p><p>T=T&#39;+T&quot;=-20-32=-52℃</p><p>考虑徐变引起的应力松弛，综合各种因素取应力松弛系数 H(t，て)为 0.3，</p><p>则程序输入的综合计算温差 T=-52×0．3=-15.6℃。</p><p><strong>计算要点</strong></p><p>1．温度荷载的分项系数一般取 1.2，组合系数一般取 0.8</p><p>2．输入完温度荷载后，要将楼板定义为弹性膜，因为结构在温度荷载作用下会产</p><p>生拉力，只有弹性楼板才能计算出拉力。</p><p>3．如果不想考虑在温度荷载作用下楼板对构件的作用，则可以将楼板删除。</p><p>4．输入最高升温和最低降温时首先要确定该部位处于自然状态下的温度值；</p><p>5．室外空气温度按照 30 年一遇最高日平均气温。冬季取 30 年一遇最低日平均气</p><p>温。使用阶段室内空气温度夏季取室内正常使用温度(是否有空调)，冬季取室内正</p><p>常使用温度（是否有采暖）。构件和结构的初始温度取成型时的环境温度。</p><p>6．由于温差内力来源于温差变形受到约束，因此对于因变形受到约束产生的应力，</p><p>对于钢筋混凝土结构则应当考虑混凝土的徐变应力松弛特性。为简化计算，建议将上</p><p>述弹性计算的温差内力乘以徐变应力松弛系数0.3，作为实际温差内力标准值进行设计。</p><p>对于钢结构，不存在徐变应力松弛，温差内力不能折减。</p><p>对于徐变应力松弛系数，设计人员可以在 SATWET 和 PMSAP；软件的温度荷载组</p><p>合值系数中加以考虑。</p><p>7、在温度荷载作用下，必须考虑构件界而裂缝的影响，因此应对梁柱砼构件截面</p><p>弹性刚度进行折减，建议，该折减系数为 0.85。</p><p>对于钢结构，其截面弹性刚度不应折减。</p><p>目前 PMSAP 软件可以通过输入弹性模量折减系数来实现截面弹性刚度的折减,而</p><p>SATWE 软件无此功能。</p><h1 id="抗拔锚杆裂缝计算" tabindex="-1"><a class="header-anchor" href="#抗拔锚杆裂缝计算" aria-hidden="true">#</a> 抗拔锚杆裂缝计算</h1><p>抗拔锚杆裂缝计算可参考广东省标准《建筑地基基础设计规范》DBJ15-31-2016 5.2.5条</p><p>混凝土结构耐久性设计规范GBT50476-2008 第3.5.4条</p><h1 id="计算框图" tabindex="-1"><a class="header-anchor" href="#计算框图" aria-hidden="true">#</a> 计算框图</h1><p><img src="'+P+'" alt=""></p><p><img src="'+v+'" alt=""></p><p><img src="'+E+'" alt=""></p><p><img src="'+w+'" alt=""></p><p><img src="'+B+'" alt=""></p><p><img src="'+j+'" alt=""></p><p><img src="'+T+'" alt=""></p><p><img src="'+H+'" alt=""></p><p><img src="'+W+'" alt=""></p><p><img src="'+u+'" alt=""></p><p><img src="'+F+'" alt=""></p><h1 id="载常数和形常数" tabindex="-1"><a class="header-anchor" href="#载常数和形常数" aria-hidden="true">#</a> 载常数和形常数</h1><p><img src="'+z+'" alt=""></p><p><img src="'+N+'" alt=""></p><p><img src="'+D+'" alt=""></p>',165)],V={},X=(0,d(83744).Z)(V,[["render",function(t,p){return(0,a.wg)(),(0,a.iD)("div",null,M)}]])},83744:(t,p)=>{p.Z=(t,p)=>{const d=t.__vccOpts||t;for(const[t,a]of p)d[t]=a;return d}},83105:(t,p,d)=>{d.r(p),d.d(p,{data:()=>a});const a=JSON.parse('{"key":"v-4004b608","path":"/study/%E4%B8%80%E6%B3%A8%E4%BE%8B%E9%A2%98.html","title":"一注例题","lang":"zh-CN","frontmatter":{"title":"一注例题","date":"2022-05-13T00:00:00.000Z","category":["学习"],"tag":["学习"],"article":true},"excerpt":"","headers":[{"level":1,"title":"科目","slug":"科目","children":[]},{"level":1,"title":"简支梁最大挠度","slug":"简支梁最大挠度","children":[]},{"level":1,"title":"一注真题注意要点","slug":"一注真题注意要点","children":[]},{"level":1,"title":"梁箍筋的面积配筋率计算","slug":"梁箍筋的面积配筋率计算","children":[]},{"level":1,"title":"柱体积配箍率计算","slug":"柱体积配箍率计算","children":[]},{"level":1,"title":"墙体积配箍率计算","slug":"墙体积配箍率计算","children":[]},{"level":1,"title":"抗震等级计算","slug":"抗震等级计算","children":[]},{"level":1,"title":"挠度计算","slug":"挠度计算","children":[]},{"level":1,"title":"软弱下卧层验算","slug":"软弱下卧层验算","children":[]},{"level":1,"title":"防水板板底等效标高","slug":"防水板板底等效标高","children":[]},{"level":1,"title":"温差、收缩当量温差计算实例","slug":"温差、收缩当量温差计算实例","children":[]},{"level":1,"title":"抗拔锚杆裂缝计算","slug":"抗拔锚杆裂缝计算","children":[]},{"level":1,"title":"计算框图","slug":"计算框图","children":[]},{"level":1,"title":"载常数和形常数","slug":"载常数和形常数","children":[]}],"git":{"updatedTime":1652668031000,"contributors":[{"name":"jiange1236","email":"183465355@qq.com","commits":5}]},"filePathRelative":"study/一注例题.md"}')}}]);